INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Molestiae nam corporis reprehenderit enim quasi cupiditate omnis.', 'Expedita unde occaecati consequatur et praesentium ea. Dolore sunt illo quia hic quo ab. Et dolor et est dolores omnis qui reiciendis laboriosam. Eum nesciunt consequatur tempore est ad iusto.', 'Ipsa atque omnis quibusdam ullam aliquid earum ab. Aut tempore voluptate hic itaque repudiandae rerum velit. Quam et tempora fugit sint. Ut eum non odio iure repudiandae.', '2017-03-01');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Quam dolores quis quaerat perspiciatis.', 'Sit inventore fugiat culpa velit. Qui nostrum quidem eos in. Odit rerum numquam beatae possimus consequatur.', 'Provident error nihil consequatur minima odit. Cum cum quia exercitationem odio perspiciatis molestiae.', '1980-12-30');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Voluptatem ut deleniti dolorem enim dolor molestiae.', 'Dignissimos quod et reprehenderit assumenda qui praesentium architecto. Aut officiis tempora voluptatem quam.', 'Aut incidunt et accusantium aut sed. Eum et et ipsam accusantium voluptatem omnis veniam. Est illo fugiat commodi.', '2008-06-30');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Rerum est eius consequatur.', 'Et occaecati eum commodi error consequatur facilis itaque. Qui temporibus quo voluptatem fugit molestiae. Vero nihil quae eum nobis minus. Corrupti beatae modi voluptas delectus deleniti.', 'Reprehenderit et non ex delectus quia sunt. Sit alias mollitia et voluptates. Dolorem perspiciatis illum ad fuga sed tempore laboriosam.', '1994-01-16');
